import React, { Component } from 'react';

import MainText from '../components/text';

class DropDown extends Component {
  render() {
    return (
      <select>
        {this.props.data.map((x, y) => (
          <option key={y}>{x}</option>
        ))}
      </select>
    );
  }
}

export default DropDown;
